	SEND_RESULT                 	char(1) NULL,
	AUTO_LOAD_BOO               	char(1) NULL,
	GEN_RESULT_FILE             	char(1) NULL,
	CANCEL_NOTIFY_MAIL          	char(1) NULL,
	MAIL_CANCEL_NOTIFICATION_ID 	UNSIGNED BIGINT NULL,
	ADJ_NOTIFY_SMS              	char(1) NULL,
	ADJ_NOTIFY_MAIL             	char(1) NULL,
	SMS_NOTIFICATION_ID         	UNSIGNED BIGINT NULL,
	MAIL_NOTIFICATION_ID        	UNSIGNED BIGINT NULL,
	CONFIRM_NOTIFY_SMS          	char(1) NULL,
	CONFIRM_NOTIFY_MAIL         	char(1) NULL,
	SMS_CONFIRM_NOTIFICATION_ID 	UNSIGNED BIGINT NULL,
	MAIL_CONFIRM_NOTIFICATION_ID	UNSIGNED BIGINT NULL,
	CREATED_BY                  	varchar(50) NOT NULL,
	CREATED                     	datetime NOT NULL,
	LAST_UPD_BY                 	varchar(50) NOT NULL,
